import logo from './logo.svg';
import './App.css';
import data from './data';
import List from './list';
import { useState } from 'react';

function App() {
  const[people,setPeople]=useState(data)
  return (
 <main>
  <section class="bg-white text-black w-50 m-6 p-6" className='container'>
    <h3 class="font-bold text-2xl font-serif p-3">{people.length} Birthdays today</h3>
   <div class="text-bold"><List  people={people}></List></div> 
    <button onClick={()=>setPeople([])}>clear all</button>
  </section>
 </main>
  );
}

export default App;
